import React, { useEffect, useState } from "react";
import axios from "axios";

export default function FormSubmit(props) {
  const [type, setType] = useState("");
  const [val, setInputVal] = useState("");
  //console.log(props.match.params.FormId);
  useEffect(() => {
    axios
      .get("http://localhost:5000/forms/getform", {
        params: {
          id: props.match.params.FormId,
        },
      })
      .then((res) => {
        //console.log(res.data);
        setType(res.data.inputType);
      });
    //console.log(forms);

    //console.log(forms);
  }, []);

  const handleSubmit = () => {};
  return (
    <div>
      <input
        type={type}
        onChange={(val) => setInputVal(val.target.value)}
      ></input>
      <input type="submit" value="Add Field" />
    </div>
  );
}
